import React from "react";

function Projects() {
  return (
    <div>
      <h1 id="projects">My Babies</h1>
      <div className="row">
        <div className="column2">
          <h4>PeriodicTables</h4>
          <p>HTML5 - CSS3 - React.js - Anime.js</p>
        </div>
        <div className="column2">
          <h4>WeLoveMovies</h4>
          <p>Express - Knex - SQL - PostgreSQL</p>
        </div>
      </div>
    </div>
  );
}

export default Projects;
